package main

import (
	"fmt"
	"strings"
)

func main1() {
	instructions := `ULL
	RRDDD
	LURDL
	UUUUD`
	instructions = `
	
	
	
	`
	s := strings.Split(instructions, "\n")

	pad := [][]int{{1, 2, 3}, {4, 5, 6}, {7, 8, 9}}

	x, y := 0, 0
	for _, v := range s {
		for _, v2 := range v {
			switch v2 {
			case 'U':
				if y > 0 {
					y--
				}
			case 'D':
				if y < 2 {
					y++
				}
			case 'L':
				if x > 0 {
					x--
				}
			case 'R':
				if x < 2 {
					x++
				}
			}
		}
		fmt.Print(pad[y][x])
	}

	//fmt.Println(s)
	//fmt.Println(pad)
	fmt.Println()
}

func main() {
	instructions2 := `ULL
	RRDDD
	LURDL
	UUUUD`
	instructions := `
	
	
	
	`
	s := strings.Split(instructions, "\n")

	pad := [][]int{{0, 0, 1, 0, 0}, {0, 2, 3, 4, 0}, {5, 6, 7, 8, 9}, {0, 10, 11, 12, 0}, {0, 0, 13, 0, 0}}

	x, y := 0, 2
	for _, v := range s {
		for _, v2 := range v {
			switch v2 {
			case 'U':
				if y > 0 && pad[y-1][x] > 0 {
					y--
				}
			case 'D':
				if y < 4 && pad[y+1][x] > 0 {
					y++
				}
			case 'L':
				if x > 0 && pad[y][x-1] > 0 {
					x--
				}
			case 'R':
				if x < 4 && pad[y][x+1] > 0 {
					x++
				}
			}
		}
		if pad[y][x] < 10 {
			fmt.Print(pad[y][x])
		} else {
			fmt.Print(string(pad[y][x] - 10 + 'A'))
		}
	}

	//fmt.Println(s)
	//fmt.Println(pad)
	fmt.Println()
	if false {
		fmt.Println(instructions2)
	}
}
